public boolean retainAll(Collection<?> collection) {
  boolean changed = false;
  for (Iterator<E> iter = iterator();
      iter.hasNext(); ) {
    Element elem = iter.next();
    if (!collection.contains(elem)) {
      iter.remove();
      changed = true;
    }
  }
  return changed;
}
